import React, { Component } from 'react'
import CommanCounter from 're'
export class hoverjs extends Component {
  
    render() {
        const {count}=this.state
        return (
            <div>
                <h1 onMouseOver={this.IncrementCounter}>Hii am Dipen  {count} </h1>
            </div>
        )
    }
}

export default CommanCounter(hoverjs)
